import Carousels, { CarouselsItem } from '../carousels/carousels';

const About = ({setLoginUser}) => {
  return (
    <div className='about'>
    <Header />
    <div className='Main'>
    <Carousels >
        <CarouselsItem ><img src={'https://t4.ftcdn.net/jpg/02/18/96/67/240_F_218966714_bJLegjVzc9KqXKVqkQI0z76zL7Hg9Uea.jpg'} alt={"Book"} width="100%" height={'400em'} /></CarouselsItem>
